import axios from "axios";
import { useAlert } from "react-alert";



export const LoginUserpost = async (mydata) => {
    const alert = useAlert();
  const config = {
    headers: { "Content-Type": "application/json" },
  };
  const req = await axios.post("/api/v1/login", mydata, config).then(
    alert.success("login successfull")).catch((error)=>{
      alert.error(error);
      console.log(error);
    });

};
